import React, { Component } from 'react';
import './Header.css';

const Header = (props) => {
    return (
      <div className="header">
        <p className="header-text"> D . M . S T U D I O </p>

        <div className="navigation__fullscreen">
                <input type="checkbox" checked={props.checked} onChange={props.handleManageCheckBox} className="navigation__checkbox" id="navi-toggle"/>
                <label htmlFor="navi-toggle" className="header__button">
                    <span className="header__icon">&nbsp;</span>
                </label>
                <div className="header__background">&nbsp;</div>

                <nav className = "header__nav">
                    <ul className = "header__list">
                        <li className="header__item" ><a href="#" className="header__link">About</a></li>
                        <li className="header__item" ><a href="#" className="header__link">Menu</a></li>
                        <li className="header__item" ><a href="#" className="header__link">Reviews</a></li>
                        <li className="header__item" ><a href="#" className="header__link">Contact</a></li>
                        </ul>
                </nav>
          </div>
      </div>
    );
}

export default Header;
